import React from 'react';
import CardList from './cardlist';
import SearchBox from './searchbox';
import { robots } from './robots';

const App = () => {
	return (
		<div className="tc bg light-pink">
			<h1>Robot Friends</h1>
			<SearchBox />
			<CardList robots={robots} />
		</div>
	);
};

export default App;
